import React from "react";

const ModalCountry = ({dataCountries}) => {
    const Lenguages = !dataCountries.languages ? null : dataCountries.languages
    if (typeof Lenguages !== 'undefined' && Lenguages !== null) {
        const keys = Object.keys(Lenguages);
      } else {
        // üëáÔ∏è this runs
        console.log('‚õîÔ∏è Object is falsy');
      }
    return (
        <><div className="modal fade" id="exampleModal" tabIndex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
            <div className="modal-dialog">
                <div className="modal-content">
                    <div className="modal-header">
                        <h1 className="modal-title fs-5" id="exampleModalLabel">{dataCountries.name}</h1>
                        <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                    </div>
                    <div className="modal-body">
                        <img src={dataCountries.flagSVG} className="img-fluid" alt={dataCountries.name} />
                        <div style={{margin: "10px 0 10px 0"}}>
                            <p>Oficial Name: {dataCountries.oficialName}</p>
                            <p>Region: {dataCountries.region}</p>
                            <p>Subregion: {dataCountries.subregion}</p>
                            <p>Capital: {dataCountries.capital}</p>
                            <p>Population: {dataCountries.population}</p>
                            <p>Area: {dataCountries.area}</p>
                            <p>Languages:</p>
                        </div>
                    </div>
                    <div className="modal-footer">
                        <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                        <button type="button" className="btn btn-primary">Save changes</button>
                    </div>
                </div>
            </div>
        </div></>
    )
}

export default ModalCountry;
